pilotos_reservas.FECHA_RESERVA,pilotos_reservas.ESTADO_RESERVA,pilotos_reservas.ESTADO_VIAJE,
pilotos_destinos.idPILOTOS,pilotos_destinos.idDESTINOS,pilotos_destinos.idSALIDAS,pilotos_destinos.DIA_HORA AS DIA_HORA_SALIDA,
destinos.DESCRIPCION AS DESTINO, b.DESCRIPCION AS SALIDA,pilotos_reservas.COMPROBANTE,
pilotos.NOMBRE_APELLIDO AS NOMBRE_PILOTO, pilotos.EMAIL AS EMAIL_PILOTO,
(pilotos_destinos.PRECIO*pilotos_reservas.ASIENTOS) AS TOTAL
FROM pilotos_reservas 
INNER JOIN pilotos_destinos on pilotos_destinos.idPILOTOS_DESTINOS=pilotos_reservas.idPILOTOS_DESTINOS
INNER JOIN pilotos on pilotos_destinos.idPILOTOS=pilotos.idPILOTOS
INNER JOIN destinos on pilotos_destinos.idDESTINOS=destinos.idDESTINOS
INNER JOIN destinos AS b on pilotos_destinos.idSALIDAS=b.idDESTINOS
INNER JOIN usuarios on pilotos_reservas.idUSUARIO=usuarios.idUSUARIO
WHERE usuarios.idUSUARIO=

